import React from "react";
import './Sidebar.css'

  function AllProducts() {
    
  
    return (
      <div>
        <input type="checkbox" id="menuicon" className="All_Products"/>
<label for="menuicon" >
              <span class="headr_products">All Products</span>
  </label>
      </div>
     
   );
  }
  
  export default AllProducts;
